import React, { useContext, useState } from "react";
import { useHistory } from "react-router-dom";
const API = process.env.REACT_APP_API;

export const Logout = () => {
    const history= useHistory();
    const res =  fetch(`${API}/logout`)
    const data = res.text();
    console.log(data)
    history.push("/")
}
